import React from "react";
import { CPage, Text } from "@appcues/component-library";

function Analytics() {
  return (
    <CPage textAlign="center">
      <CPage.Container>
        <Text>Future home of Appcues Analytics!</Text>
      </CPage.Container>
    </CPage>
  );
}

export default Analytics;
